//Dependencies
import React, {Component} from 'react';
import pantsPlaceholder from '../../assets/browser/pantsPlaceholder.jpg';
import Card from 'react-bootstrap/Card';
import Button from 'react-bootstrap/Button';

class ClotheCardTest extends Component{
  render(){
    return(
      <Card style={{ width: '120px',height:'120px' }}>
        <Card.Img variant="top" src={pantsPlaceholder} />
        <Card.Body>
          <Card.Title>Pants</Card.Title>
          <Card.Text>
            Some fancy pants I bought a while ago. Haven't used them
            much.
          </Card.Text>
          <Button variant="primary">Buy</Button>
        </Card.Body>
      </Card>
    );
  }
}

export default ClotheCardTest;
